import logo from "./logo.svg";
import "./App.css";
import TextField from "@mui/material/TextField";
import { React, useState } from "react";

const MoviesController = () => {

  const getMoviesList = async(movie) => {
    const response = await fetch("https://imdb-api.com/API/Search/k_703qlath/" + movie);
    const movies = await response.json();
    const result = movies.results;
    return result;
  }

  const getMovieID = async(ID) => {
    const response = await fetch("https://imdb-api.com/en/API/Ratings/k_703qlath/"+ID);
    const movies = await response.json();
    const result = movies.results;
    return result;
  }

}

export default MoviesController;
